import React from 'react';

import classes from './ImageControl.module.css';


const imageControl = ( props ) => (
    <div className={classes.imageControl}>
        <div>IMAGE 1</div>
        <div>IMAGE 2</div>
        <div>IMAGE 3</div>
        <div>IMAGE 4</div>
    </div>
)

export default imageControl;
